      <Paper> <img src={mochila} width="25%" height="60px" /> 
    <u> <h2> Tema 2 </h2> </u>
      </Paper>
      <Paper> <img src={calculadora} width="25%" height="60px" /> 
    <u> <h2> Tema 3 </h2> </u>
      </Paper>
    </div>
  );
}
